import React from 'react';
import './form.css';

const Form = () => {
  return (
    <div className="form-container">
      <form className="form">
        <h2 className="form-title">Stock Graph</h2>
        <div className="form-group">
          <label htmlFor="stock-name" className="form-label">Stock Name</label>
          <input type="text" id="stock-name" name="stock-name" className="form-input" required />
        </div>
        <button type="submit" className="form-button">Submit</button>
      </form>
    </div>
  );
};

export default Form;
